import Foundationimport google_mobile_adsclass InverseSmallNativeAdFactory: NSObject, FLTNativeAdFactory {    func createNativeAd(        _ nativeAd: NativeAd,        customOptions: [AnyHashable : Any]? = nil    ) -> NativeAdView {                guard let nibObjects = Bundle.main.loadNibNamed("InverseSmallNativeAdView", owner: nil, options: nil),              let nativeAdView = nibObjects.first as? NativeAdView else {            fatalError("Could not load InverseSmallNativeAdView.xib")        }        // Headline        if let headlineView = nativeAdView.headlineView as? UILabel {            headlineView.text = nativeAd.headline        }        // Body        if let bodyView = nativeAdView.bodyView as? UILabel {            bodyView.text = nativeAd.body            bodyView.isHidden = nativeAd.body == nil        }        // Icon        if let iconView = nativeAdView.iconView as? UIImageView {            iconView.image = nativeAd.icon?.image            iconView.isHidden = nativeAd.icon == nil        }        // Call to Action        if let callToActionView = nativeAdView.callToActionView as? UIButton {            callToActionView.setTitle(nativeAd.callToAction, for: .normal)            callToActionView.isUserInteractionEnabled = false        }        // Assign native ad to view        nativeAdView.nativeAd = nativeAd        return nativeAdView    }}